struct Solution;

impl Solution {
    pub fn max_area(height: Vec<i32>) -> i32 {
        let mut l = 0;
        let mut r = height.len() - 1;
        let mut max_min_h = height[l].min(height[r]);
        let mut max = max_min_h * (r - l) as i32;
        while l != r {
            if height[l] < height[r] {
                l += 1;
                if height[l] > max_min_h {
                    let min_h = height[l].min(height[r]);
                    let val = min_h * (r - l) as i32;
                    if val > max {
                        max_min_h = min_h;
                        max = val;
                    }
                }
            } else {
                r -= 1;
                if height[r] > max_min_h {
                    let min_h = height[l].min(height[r]);
                    let val = min_h * (r - l) as i32;
                    if val > max {
                        max_min_h = min_h;
                        max = val;
                    }
                }
            }
        }
        max
    }
}